import React from 'react'
import { Typography, Grid, Box, Container } from '@material-ui/core'
import { makeStyles } from '@material-ui/core/styles'
import InstagramIcon from '@material-ui/icons/Instagram'

const useStyles = makeStyles({
    footer:{
        textAlign: "left"
    }
});

export default function Footer() {
    const classes = useStyles();
    return (
        <footer className={classes.footer}>
            <Container maxWidth="lg">
                <Grid container spacing="5">
                    <Grid item xs="12" sm="6" md="3">
                        <Box marginBottom="25px">Our Story</Box>
                        <Box marginBottom="25px">Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</Box>
                    </Grid>
                </Grid>
            </Container>
        </footer>
    )
}
